function Covid() {
  return (
    <section className="covid-section">
       <span>Covid-19 Closure Notice!</span>
       <span> We have closed both of our studios to ensure the safety of all members. To keep updated of when we'll be reopening please follow our <a href="https://www.instagram.com/inferno_fitness_dublin" target="_blank">Instagram </a></span>
    </section>
  );
}

export default Covid;
